  `others_Type` int(2) DEFAULT NULL,
  `FDRforType` tinyint(1) NOT NULL DEFAULT '0',
  `TermOwnFund` tinyint(1) DEFAULT '1',
  `DealPurpose` char(10) NOT NULL,
  `BankNature` char(10) DEFAULT NULL,
