  `u_by` int(11) DEFAULT NULL,
  `u_dt` date DEFAULT NULL,
  `fv_by` int(11) DEFAULT NULL,
  `fv_dt` datetime DEFAULT NULL,
  `bv_by` int(11) DEFAULT NULL,
  `bv_dt` datetime DEFAULT NULL,
  `d_by` int(11) DEFAULT NULL,
  `d_dt` datetime DEFAULT NULL,
  `d_reason` text,
  `sts` tinyint(1) NOT NULL DEFAULT '1',
  `SettlementType` varchar(30) NOT NULL DEFAULT '',
  `FUL` varchar(10) NOT NULL,
  `Days` int(20) DEFAULT NULL,
  `InterestbyDays` decimal(64,4) DEFAULT NULL,
  `CrosspondingDeal` int(100) DEFAULT NULL,
  `full_dt` date DEFAULT NULL,
  `overnight_used` decimal(50,2) DEFAULT NULL,
  `term_used` decimal(50,2) DEFAULT NULL,
  `settlement_used` decimal(50,2) DEFAULT NULL,
  `spot_used` decimal(50,2) DEFAULT NULL,
  `thE_used` decimal(50,2) DEFAULT NULL,
  `mdE_used` decimal(50,2) DEFAULT NULL,
