/*Table structure for table `b2_mmdeal_full` */

DROP TABLE IF EXISTS `b2_mmdeal_full`;

CREATE TABLE `b2_mmdeal_full` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `Serial` bigint(20) NOT NULL,
  `deal_ref_counter` int(11) NOT NULL DEFAULT '0',
  `deal_ref_no` varchar(50) DEFAULT NULL,
  `DealTypeId` int(2) NOT NULL DEFAULT '0',
  `party_name` varchar(255) DEFAULT NULL,
  `others_Type` int(2) DEFAULT NULL,
  `FDRforType` tinyint(1) NOT NULL DEFAULT '0',
  `TermOwnFund` tinyint(1) DEFAULT '1',
  `DealPurpose` char(10) NOT NULL,
  `BankNature` char(10) DEFAULT NULL,
  `CounterPartyId` int(11) NOT NULL DEFAULT '0',
  `CurrencyId` int(4) NOT NULL DEFAULT '0',
  `Amount` decimal(64,2) NOT NULL DEFAULT '0.00',
  `ADJUSTAMOUNT` decimal(64,2) NOT NULL,
  `Rate` decimal(64,2) NOT NULL DEFAULT '0.00',
  `SettlementAmt` decimal(64,2) NOT NULL,
  `ValueDate` date NOT NULL DEFAULT '0000-00-00',
  `MaturityDate` date NOT NULL DEFAULT '0000-00-00',
  `DealSpecialInstruction` longtext,
  `DealSettlementInstruction` longtext,
  `OurSettlementInstruction` varchar(100) NOT NULL DEFAULT '',
  `CounterPartySettlementInstruction` varchar(100) NOT NULL DEFAULT '',
  `FontofficeComent` varchar(200) DEFAULT NULL,
  `BackOfficeComments` varchar(200) NOT NULL,
  `ChequeNo` varchar(100) NOT NULL DEFAULT '',
  `amendments_sts` tinyint(1) NOT NULL DEFAULT '0',
  `AmendmentComments` varchar(200) NOT NULL,
  `AmendmentComments_fo` varchar(200) DEFAULT NULL,
  `e_by` int(11) DEFAULT NULL,
  `e_dt` datetime DEFAULT NULL,
  `u_by` int(11) DEFAULT NULL,
  `u_dt` date DEFAULT NULL,
  `fv_by` int(11) DEFAULT NULL,
  `fv_dt` datetime DEFAULT NULL,
  `bv_by` int(11) DEFAULT NULL,
  `bv_dt` datetime DEFAULT NULL,
  `d_by` int(11) DEFAULT NULL,
  `d_dt` datetime DEFAULT NULL,
  `d_reason` text,
  `sts` tinyint(1) NOT NULL DEFAULT '1',
  `SettlementType` varchar(30) NOT NULL DEFAULT '',
  `FUL` varchar(10) NOT NULL,
  `Days` int(20) DEFAULT NULL,
  `InterestbyDays` decimal(64,4) DEFAULT NULL,
  `CrosspondingDeal` int(100) DEFAULT NULL,
  `full_dt` date DEFAULT NULL,
  `overnight_used` decimal(50,2) DEFAULT NULL,
  `term_used` decimal(50,2) DEFAULT NULL,
  `settlement_used` decimal(50,2) DEFAULT NULL,
  `spot_used` decimal(50,2) DEFAULT NULL,
  `thE_used` decimal(50,2) DEFAULT NULL,
  `mdE_used` decimal(50,2) DEFAULT NULL,
  `Pre_reset_deal_no` varchar(200) NOT NULL DEFAULT '0',
  `Reset_Status` tinyint(1) NOT NULL DEFAULT '0',
  `ALS` tinyint(1) NOT NULL DEFAULT '0',
  `repo_parameters` varchar(20) DEFAULT NULL COMMENT 'yield,per100,basis',
  `rtgs_sts` tinyint(2) NOT NULL DEFAULT '0',
  `our_ssi_id` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `CrosspondingDeal` (`CrosspondingDeal`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

